import React from 'react';
import SVGIcon from './SVGIcon';

const PauseIcon = ((props) => (
  <SVGIcon {...props}>
    <rect fill="#FFFFFF" x="6" y="5" width="4" height="14" rx="0.5" />
    <rect fill="#FFFFFF" x="14" y="5" width="4" height="14" rx="0.5" />
  </SVGIcon>
));
export default PauseIcon;
